const buttonType = [
    {
        id: 1,
        mathFunction: "Add",
        symbol: "+"
    },
    {
        id: 2,
        mathFunction: "Subtract",
        symbol: "-"
    },
    {
        id: 3,
        mathFunction: "Multiply",
        symbol: "x"
    },
    {
        id: 4,
        mathFunction: "Divide",
        symbol: "%"
    },
    {
        id: 5,
        mathFunction: "Equals",
        symbol: "="
    }
]

export default buttonType;
